export default function Sidebar(){
    return(
        <section className="filters">
            <span className="filter-category">Clothing / Women's / Outerwear</span>
            <span className="filter-head">Filters</span>
            <h5>Attribute</h5>
            <div className="filter-option">
                <input type="checkbox" id="option1" name="option1" value="option1"/><label for="option1">Option</label>
                <input type="checkbox" id="option2" name="option2" value="option1"/><label for="option2">Option</label>
                <input type="checkbox" id="option3" name="option3" value="option1"/><label for="option3">Option</label>
                <input type="checkbox" id="option4" name="option4" value="option1"/><label for="option4">Option</label>
            </div>
            

        </section>
    );
}
